import User from './User';


class Users extends Component {
	state = {
		users : [
			{name: "John", age : 12},
			{name: "Abhi", age : 13}
		],
		title : "User List"
	};

	makeStateChange = () => {
		var incrementAge;
		var i;
		console.log("type of", incrementAge);
		this.users.forEach((user) => {
      console.log(user.name + ' has lived in ' + user.age);
   	});
		//this.setState ({

		//users: 
   	//	users: users
		//})

	}
  render() {
    return (
    	<div>
	        <button onClick={this.makeStateChange}>Make me Younger </button>

	        <User age={this.state.users[0].age}>{this.state.users[0].name}</User>
	        <User age={this.state.users[1].age}>{this.state.users[1].name}</User>
      </div>
    )
  }
}

export default Users;
